sys_variable_value.value:
(function execute(inputs, outputs) {
  var statusCode = inputs.statuscode;
  var responseBody = inputs.responsebody;
  var toolHandler;
  var pipelines = [];
  var codefreshPipelineDiscoverPayload = {};
  sn_devops.DevOpsLogger.log("Codefresh discover subflow status code is " + inputs.statuscode);
  if(statusCode == '200') {
    toolHandler = new CodefreshIntegrationHandler();
    codefreshPipelineDiscoverPayload.pipelines = toolHandler.processPipelineDiscoveryApiResponse(inputs.toolUrl, responseBody);
  }
  outputs.discoverpayload = JSON.stringify(codefreshPipelineDiscoverPayload);
  sn_devops.DevOpsLogger.log("Codefresh discover subflow pipelines are " + outputs.discoverpayload);
})(inputs, outputs);

